import React from 'react';
import Room from './Room';
import {Row} from "react-bootstrap";
import * as ReactDOM from 'react-dom';

function RoomList(){
    ReactDOM.render(<Room/>, document.getElementById("Room")); 
    return(
        <div id="RoomList">
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
        </div>
    );
}

export default RoomList
